import React from "react";

function EmployeList({ list, showAlert, empID }) {
  console.log(list);
  console.log(empID);

  const empDept = list.map((emp, index) => (
    <h3 onClick={() => setSendId(emp.id)} key={index}>
      {emp.name}
    </h3>
  ));
}

export default EmployeList;
